VALUES ('3329770057531', 'Yaourts aux fruits Panier de Yoplait L’Original', 'YAOURT SUCRÉ, AUX FRUITS INGRÉDIENTS I Yaourt (Lait écrémé à base de poudre de lait - Lait écrémé - Crème - Poudre de lait écrémé - Ferments lactiques) - Fruits : Pêche 1 1.3% ou Abricot 11.1 % ou Fraise 10.8% ou Cerise 10.7% ou Ananas 10.6% ou Mûre - Sucre 8.9% - Jus de carotte -Amidon transformé de maïs - Jus de potiron - Epaississant : Carraghénanes - Correcteurs d\'acidité : Citrates de potassium, Citrates de sodium, Acide citrique - Arômes naturels. Lait d\'origine France. Sans gluten. *Sans colorant : la couleur est apportée par des jus de fruits ou de légumes. Malgré tout le soin apporté à la sélection des fruits, ce produit peut contenir des noyaux ou morceaux de noyaux de cerise. GESUIKERDE YOGHURT MET VRUCHTEN INGREDIËNTEN \'Yoghurt (Afgeroomde melk op basis van melkpoeder - Afgeroomde melk - Room - Afgeroomde melkpoeder - Melkfermenten) - Vruchten: Perzik 1 1.3% of Abrikoos 11.1 % of Aardbei 10.8% of Kers 10.7% of Ananas 10.6% of Braambes 10% - Suiker 8.9% - Wortelsap - Getransformeerd maïszetmeel - Pompoensap - Verdikkingsmiddel: Carrageen - Zuurteregelaars: Kaliumcitraten, Natriumcitraten, Citroenzuur - Natuurlijke aromals. Glutenvrije. *Zonder kleurstof: de smaken worden gekleurd met sap van fruit of groenten. Ondanks onze zorgvuldige selectie van fruit kan dit product kersenpiffen of stukjes van kersenpiffen bevaffen. &quot;POUR LA BELGIQUE : CONSERVATION ENTRE OOC ET +70c MAX. VOOR BELGIE: KOEL BEWAREN TUSSEN OOC EN MAX +rc.', 'https://static.openfoodfacts.org/images/products/332/977/005/7531/front_fr.7.400.jpg', '2.6', '1.7', '13.2', '12.8', '0.2', '3.2', '0.13', '0.0511811023622047', '', '1');

